import React from 'react';
import { useHistory } from 'react-router-dom'
import { useSelector } from 'react-redux'


function Profile() {
    let history = useHistory();

    const name = useSelector(state => state.data.name);


    return(
        <div>
            {name}
            <h2>Profile</h2>
        </div>
    );
}

export default Profile;
